// src/App.js
import React, { useState, useEffect } from 'react';
import { TextField, MenuItem, Button, Select, FormControl, InputLabel, Chip, Box, OutlinedInput } from '@mui/material';

function App() {
  const [users, setUsers] = useState([]);
  const [items, setItems] = useState([]);
  const [selectedUser, setSelectedUser] = useState('');
  const [selectedItems, setSelectedItems] = useState([]);
  const [preview, setPreview] = useState([]);
  const [totalAmount, setTotalAmount] = useState(0);

  useEffect(() => {
    // Fetch data from JSON file
    fetch('/data.json')
      .then(response => response.json())
      .then(data => {
        setUsers(data.users);
        setItems(data.items);
      });
  }, []);

  const handleUserChange = (event) => {
    setSelectedUser(event.target.value);
  };

  const handleItemsChange = (event) => {
    const { target: { value } } = event;
    setSelectedItems(typeof value === 'string' ? value.split(',') : value);
  };

  const handleSave = () => {
    const itemPrices = selectedItems.map(itemId => {
      const item = items.find(i => i.id === itemId);
      return { ...item };
    });
    const userPreview = {
      user: users.find(user => user.id === selectedUser),
      items: itemPrices,
      totalPrice: itemPrices.reduce((sum, item) => sum + item.price, 0)
    };
    setPreview([...preview, userPreview]);
    setTotalAmount(totalAmount + userPreview.totalPrice);
  };

  const handleDelete = (index) => {
    const newPreview = [...preview];
    const [removed] = newPreview.splice(index, 1);
    setPreview(newPreview);
    setTotalAmount(totalAmount - removed.totalPrice);
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>CAFETERIA</h1>
      <h2>Total Amount: {totalAmount}</h2>
      <FormControl fullWidth margin="normal">
        <InputLabel>Select User</InputLabel>
        <Select
          value={selectedUser}
          onChange={handleUserChange}
          input={<OutlinedInput label="Select User" />}
        >
          {users.map((user) => (
            <MenuItem key={user.id} value={user.id}>
              {user.name}
            </MenuItem>
          ))}
        </Select>
      </FormControl>
      <FormControl fullWidth margin="normal">
        <InputLabel>Select Food</InputLabel>
        <Select
          multiple
          value={selectedItems}
          onChange={handleItemsChange}
          input={<OutlinedInput label="Select Food" />}
          renderValue={(selected) => (
            <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 0.5 }}>
              {selected.map((value) => (
                <Chip key={value} label={items.find(item => item.id === value).name} />
              ))}
            </Box>
          )}
        >
          {items.map((item) => (
            <MenuItem key={item.id} value={item.id}>
              {item.name}
            </MenuItem>
          ))}
        </Select>
      </FormControl>
      <Button variant="contained" color="primary" onClick={handleSave}>
        Save
      </Button>
      <h2>Preview</h2>
      {preview.map((userPreview, index) => (
        <div key={index} style={{ border: '1px solid #ccc', margin: '10px 0', padding: '10px' }}>
          <h3>{userPreview.user.name}</h3>
          <ul>
            {userPreview.items.map((item, idx) => (
              <li key={idx}>{item.name}: {item.price}</li>
            ))}
          </ul>
          <p>Total Price: {userPreview.totalPrice}</p>
          <Button variant="outlined" color="secondary" onClick={() => handleDelete(index)}>
            Delete
          </Button>
        </div>
      ))}
    </div>
  );
}
export default App;
